import {Link} from 'react-router-dom'
const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>Dodo Restaurant</h1>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/menu">Menu</Link>
                <Link to="/orderonline" style={{
                    color: "white",
                    backgroundColor: '#f1356d',
                    borderRadius: '8px'
                }}>Order Online</Link>
                <Link to="/create" style={{
                    color: "white",
                    backgroundColor: '#f1356d',
                    borderRadius: '8px'
                }}>Book Now</Link>
            </div>
        </nav>
    );
}

export default Navbar;
